import './styles/App.css';
import logo from './logo.png';

function App() {
  return (
    <div className="bg-[#efefef]">
      <header>
        <img src={logo} alt="Logo" className="pl-[10px] pr-0 py-0" />
      </header>
    </div>
  );
}

export default App;
